import React, {useState, useEffect} from 'react'

export default function Leftcategory() {

    const [category, setCategory] = useState([]);

    useEffect(() => {
     
        fetch('https://fakestoreapi.com/products/categories');
        console.log()

        .then(response => response.json())
        .then(data => {
            setCategory(data)
        })

    }, [])

  return (
            <div>
                <h2>Category</h2>



            </div>

  )
}
